import React, { useState } from 'react';

const ChatFirstLayout = () => {
  const [messages, setMessages] = useState([
    { sender: 'bot', text: 'Hi! Letâ€™s assess your COVID-19 risk. What symptoms are you experiencing?' },
  ]);
  const [step, setStep] = useState(0);
  const [input, setInput] = useState('');
  const [userData, setUserData] = useState({ symptoms: '', travel: '', vaccine: '' });

  const handleSend = () => {
    if (!input.trim()) return;

    const newMessages = [...messages, { sender: 'user', text: input }];

    let nextMessages = [];
    let newStep = step + 1;
    const updatedUserData = { ...userData };

    if (step === 0) {
      updatedUserData.symptoms = input;
      nextMessages.push({ sender: 'bot', text: 'Have you traveled recently or been in contact with a COVID-positive person?' });
    } else if (step === 1) {
      updatedUserData.travel = input;
      nextMessages.push({ sender: 'bot', text: 'Have you been vaccinated (fully/partially)?' });
    } else if (step === 2) {
      updatedUserData.vaccine = input;
      const risk = calculateRisk(updatedUserData);
      nextMessages.push({ sender: 'bot', text: `Your assessed COVID-19 risk is: ${risk}` });
      nextMessages.push({ sender: 'bot', text: 'Here are nearby test centers: [link]' });
      nextMessages.push({ sender: 'bot', text: 'Need help? Ask me any COVID-related question!' });
    } else {
      nextMessages.push({ sender: 'bot', text: 'I can help with COVID-related queries. For example, ask about symptoms, recovery, or vaccine info.' });
    }

    setUserData(updatedUserData);
    setMessages([...newMessages, ...nextMessages]);
    setStep(newStep);
    setInput('');
  };

  const calculateRisk = ({ symptoms, travel, vaccine }) => {
    const s = symptoms.toLowerCase();
    const t = travel.toLowerCase();
    const v = vaccine.toLowerCase();
    if (s.includes('fever') && s.includes('cough')) return 'High';
    if (t.includes('yes') && !v.includes('fully')) return 'Medium';
    if (!s || s === 'none') return 'Low';
    return 'Medium';
  };

  return (
    <div style={{ display: 'flex', minHeight: '100vh', fontFamily: 'Segoe UI' }}>
      {/* Sidebar */}
      <aside style={{ width: '250px', background: '#1e293b', color: 'white', padding: '1rem' }}>
        <h2>Quick Links</h2>
        <ul style={{ listStyle: 'none', padding: 0 }}>
          <li><a href="#" style={{ color: 'white' }}>Local Stats</a></li>
          <li><a href="#" style={{ color: 'white' }}>Government Policies</a></li>
          <li><a href="#" style={{ color: 'white' }}>Nearby Test Centers</a></li>
        </ul>
      </aside>

      {/* Chat Interface */}
      <main style={{ flex: 1, background: '#f1f5f9', padding: '2rem' }}>
        <h1>COVID AI Chatbot</h1>
        <div style={{ background: 'white', padding: '1rem', borderRadius: '8px', height: '60vh', overflowY: 'auto', marginBottom: '1rem' }}>
          {messages.map((msg, idx) => (
            <div key={idx} style={{ textAlign: msg.sender === 'bot' ? 'left' : 'right', margin: '0.5rem 0' }}>
              <strong>{msg.sender === 'bot' ? 'ðŸ¤–' : 'You'}:</strong> {msg.text}
            </div>
          ))}
        </div>
        <div>
          <input
            value={input}
            onChange={(e) => setInput(e.target.value)}
            placeholder="Type your response..."
            style={{ width: '80%', padding: '0.5rem', fontSize: '1rem' }}
          />
          <button onClick={handleSend} style={{ padding: '0.5rem 1rem', marginLeft: '0.5rem' }}>Send</button>
        </div>
      </main>
    </div>
  );
};

export default ChatFirstLayout;
